import React from 'react'
import { useEffect, useState } from 'react'
import './Profile.css'
import Profiledetails from './Profile/profiledetails.js'
import Postcontainer from './Profile/profile-posts/postcontainer.js'

function ProfilePG({ username }) {

  const [userData, setUserData] = useState();

  fetch('http://localhost:5000/api/userdata', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({ username })
  })
  .then(response => response.json())
  .then(data => {setUserData(data)})
  .catch(error => console.error(error));
  return (
    <div className='ProfilePG'>
      <Profiledetails userData={userData} />
      <Postcontainer username={username} />
    </div>
  )
}

export default ProfilePG
